                three: "他於羅馬渡過十年後，遇上其奢華世界的伯樂Franco Cologni。他隨後遷至米蘭，並在當地開設其首家設計珠寶、腕錶及配飾的工作室，同時始終不忘早年的熱情：雕塑與繪畫。",
