                content: "<h3>關於 Giampiero Bodino 和這些使用條款</h3><p>Giampiero Bodino AG的註冊辦公地址為Hinterbergstrasse 22, Steinhausen, Switzerland。平臺歸 Giampiero Bodino 所有並由其編輯。</p><p>這些使用條款適用於您對 Giampiero Bodino 網站和行動應用程式（統稱為「平臺」）的使用。在這些使用條款中，我們使用 Giampiero Bodino （以及「我們」和「我們的」）一詞來指位於上述註冊地址的 Giampiero Bodino 總部、分支機搆和專賣店。</p><p>使用該平臺之前，請仔細閱讀這些使用條款。透過使用該平臺，即表明您贊成並同意這些使用條款。如果您不同意這些使用條款，則無權繼續使用該平臺。</p><h4>對這些使用條款的更新</h4><p>我們可能會不時變更這些使用條款，因此請定期查看以瞭解最新更新條款。該平臺會隨時更新使用條款的最新版本。這些使用條款的任何新版本均將自發佈之日起立即生效，並適用於該平臺的使用以及您與我們之間的關係。一旦繼續使用該平臺，即表示您同意遵守這些更新和修訂的條款。</p><h3>關於我們的主機託管服務</h3><p>我們網站的主機託管服務由Richemont International SA提供，所在國家/地區為瑞士。<br>行動應用程式可能由我們自己或其他公司託管，您應該參考這類公司的相關條款。</p><h3>我們的隱私權政策</h3><p>我們在平臺上收集資料的做法（如我們所收集的有關平臺訪客的資料類型以及我們可能使用該等資料的方式）適用我們<a href='#privacy_policy'>隱私權政策</a>的條款。</p><h3>平臺材料的使用</h3><p>Giampiero Bodino 建立了各種平臺來提供有關其公司和供您個人使用之產品的資訊。雖然我們努力確保平臺上展示的 Giampiero Bodino 產品的視覺表達能夠呈現最初產品的顏色、設計和風格等，但是在與最初產品作比較時，可能會稍有偏差、失真和/或差別。這種原因可能因技術問題導致，例如您的瀏覽器或電腦設定。同樣，對於平臺產品圖片和最初產品呈現出來的任何明顯差別，Giampiero Bodino 不承擔任何責任。進行線上購買或電話購買之前，我們強烈建議您事先造訪我們其中某個專賣店或授權零售商。</p><p>您可以將透過平臺提供給您的材料下載一份電腦副本或列印一份副本，或將該應用程式下載到您的行動裝置上並僅用於您自己非商業、教育、私人或家庭的用途，但前提是完好保留專利權聲明，尤其是智慧財產權聲明（如版權符號 ©、商標符號™），不得修改、刪除或變更。除非另有說明，否則您應假定您在平臺上所看到或讀到的所有內容（如圖片、照片（包括照片中呈現的任何人物）、圖解、圖示、文字、短片、音樂、書面及其他材料）（「Giampiero Bodino 材料」）均受諸如版權、設計和商標立法之類的立法以及國際公約和世界各國法律的保護。</p><p>您未獲授權出售、複製、分發、傳播、修改、展示、公開演示、報告或以其他方式製作基於任何 Giampiero Bodino 材料的衍生或二手作品，或出於任何公開或商業的目的而以任何方式使用任何這類材料。此外，亦不得出於任何目的而在任何其他平臺上、在聯網的電腦環境中或在任何其他數碼平臺上展示或傳播 Giampiero Bodino 材料。如果違反這些使用條款中的任一條款，您的 Giampiero Bodino 材料使用許可即自動終止，並須立即銷毀所製作的任何 Giampiero Bodino 材料副本。任何擅自使用 Giampiero Bodino 材料的行為均可能違反版權法、商標法、隱私權和公開權保護法以及傳播法規和法令。</p><h3>您的意見書和未經請求的通訊</h3><p>本節內容介紹了傳送給 Giampiero Bodino 的通訊。它不包括傳送給 Giampiero Bodino 的、與客戶詢問、服務使用或透過電話或平臺購買產品有關的個人資料通訊。後面這種情況適用<a href='#privacy_policy'>隱私權政策</a>中規定的條款。</p><p>任何未經請求的通訊或您透過平臺或社交媒體、透過電郵或其他方式傳輸給 Giampiero Bodino 的材料（包括但不限於任何資料、提問或答案、評論、建議或類似資訊）都將作為非機密資訊進行處理，亦不屬於 Giampiero Bodino 的財產。透過向 Giampiero Bodino 傳送通訊，即表明您自動授權 Giampiero Bodino 在全球範圍內擁有免版稅的、永久的、不可撤銷的非獨家許可權來使用、複製、修改、出版、編輯、翻譯、分發、執行和展示這類通訊，或者透過任何方式作為任何其他作品、媒體或技術的一部分，無論是目前已知的還是後來開發出來的，並且將這類權利轉授給任何人。對於您傳輸的任何資訊，Giampiero Bodino 及其附屬公司均可用於任何目的，包括但不限於複製、披露、傳輸、出版、廣播和公佈，或者使用此等資訊進行產品開發、生產和行銷。</p><p>全新高級珠寶精品名牌Giampiero Bodino 在義大利文化藝術的啟發下承諾創作出頂級珠寶精品。爆發性的色彩、波狀型的設計和精湛的工藝將藝術家的當代視界展現在眼前。為此，公司擁有自己的創意渠道，特別是技藝精湛的設計師團隊，他們對 Giampiero Bodino 的創意進行構思和完善。因此，Giampiero Bodino 絕不同意或接受未經請求的合作建議。事實上，可想而知的是，Giampiero Bodino 可能已經正在研究類似的想法和/或創意。因此，您會被告知 Giampiero Bodino 對您希望提交的與創意有關的想法或其他提案並不感興趣。</p><h3>責任範圍</h3><p>本節規定適用於平臺，但不適用於透過線上或電話或其中某個本地或區域市場銷售的產品。</p><p>Giampiero Bodino 試圖確保所提供的資訊完整準確。但是，Giampiero Bodino 不能保證或擔保 Giampiero Bodino 的材料準確、無錯誤或可靠，亦不擔保使用 Giampiero Bodino 材料不會侵犯第三方的權利。</p><p>Giampiero Bodino 不擔保平臺在功能和/或技術方面或 Giampiero Bodino 材料沒有錯誤，亦不擔保平臺、Giampiero Bodino 材料或提供該等材料的伺服器無病毒或其他有害元件。如果因使用平臺或 Giampiero Bodino 材料而導致需要維修或更換財產、材料、裝置、資料或其他要素，Giampiero Bodino 概不承擔相關費用。在不限制前述條款的前提下，平臺上的一切均為「依原樣」且「按可用狀態」提供給您，且在相關法律允許的最大範圍內，不含任何種類的明示或默示擔保，包括但不限於有關適銷性、質量滿意度、特定目的適用性、合理審慎措施和技能或不侵權方面的默示擔保。對於 Giampiero Bodino 材料、軟體、文字、下載、圖形和連結，或者對於平臺使用導致的任何結果，Giampiero Bodino 及其供應商概不提供任何擔保。</p><p>在相關法律允許的最大範圍內，Giampiero Bodino 概不承擔源自或有關使用平臺可用資訊的任何類型的間接、附帶、特殊或因果性損害賠償責任，或與任何用途喪失、業務中斷、利潤損失或資料丟失相關的任何責任，而無論訴訟的形式，亦無論性質是合同、民事侵權（包括疏忽）還是其他，即使 Giampiero Bodino 已經獲悉該等損害的可能性也不例外。</p><p>請注意，在某些司法管轄區，消費者保護法可能不允許某些擔保或責任的排除或限定，因此上述某些免責和限定條款可能並不適用。</p><h3>商標聲明</h3><p>一般而言，出現在平臺上的所有商標、標誌和服務標章（統稱為「商標」）均為註冊、非註冊或以其他方式受保護的 Giampiero Bodino 商標，或由第三方許可 Giampiero Bodino 使用。其他商標均為專屬標誌，由其各自的所有者註冊。平臺上所包含的任何內容均不得被解釋為以默示或其他方式授予在未經 Giampiero Bodino 或擁有相關商標之第三方事先書面允許的情況下使用該等商標的任何許可或權利。除此處所規定的情形外，嚴禁濫用平臺上顯示的任何商標或平臺上的任何其他內容。</p><h3>版權聲明</h3><p>平臺上的所有內容（包括Giampiero Bodino 材料）的版權©均歸 Giampiero Bodino 所有，或者由 Giampiero Bodino 授權使用。保留所有權利。有關平臺上的材料使用，請參閱以上所述的相關部分。</p><h3>連結</h3><p>平臺上可能包含與 Giampiero Bodino 無關聯的第三方運營之其他平臺的連結。包含任何轉至該等第三方網站的連結，並不意味著 Giampiero Bodino 認可該等網站。Giampiero Bodino 未曾審閱該等連結網站所包含的全部內容，因此對連結到任何平臺的任何站外網頁或任何其他網站的內容或準確性概不負責。如果您選擇點擊存取任何到站外網頁或第三方網站的連結，則風險自擔。未事先獲得明確書面授權的情況下，Giampiero Bodino 並沒有授權任何第三方平臺連結其任何平臺。</p><h3>終止與暫停</h3><p>您同意，如果 Giampiero Bodino 合理地認為您違反或背離了這些使用條款的明文規定或精神，或侵犯了 Giampiero Bodino、其附屬公司或任何第三方的權利，Giampiero Bodino 則可在通知或不通知您的情況下終止或暫停您進入和使用平臺。您同意，Giampiero Bodino 可以在通知或不通知您的情況下修改或中斷提供任何平臺。您同意，Giampiero Bodino 不會因為該等修改或中斷而對您或任何第三方承擔責任。標題為「責任範圍」和「一般條款」部分的條款將在這些使用條款終止後繼續有效。</p><h3>一般條款</h3><p>除非另有規定，否則平臺上顯示的資訊和材料僅可用於促銷 Giampiero Bodino 的產品和服務，以及在特定情況下用於透過各種途徑進行產品展銷。Giampiero Bodino 不擔保 Giampiero Bodino 材料合適和可用於世界上的每一個國家/地區。您應該遵守適用的當地法律，牢記取得 Giampiero Bodino 材料對於特定人員或在特定國家/地區是不合法的。我們的產品在世界上許多國家/地區都有提供。但是，平臺可能會區分一些沒有在全球範圍內提供的產品。</p><p>如果這些使用條款中的任一條款或其部分內容被認定為非法、無效或不可執行，則該等條款或部分內容應被視為不屬於這些使用條款的組成部分，且這些使用條款之剩餘部分的合法性、有效性或可執行性不應受到影響，但相關法律另有規定的情形除外。</p><p>這些使用條款構成您與我們之間就平臺的使用所達成的完整協議，並取代和廢止之前雙方就該等主題事宜達成的所有口頭或書面的協定、協定草案、安排、承諾或任何性質的附屬合同。</p><p>若Giampiero Bodino 放棄追究對這些使用條款之任何規定的違約行為，不應被解釋為放棄追究任何其他或後續的違約行為。</p><h3>適用法律與司法管轄權</h3><p>這些使用條款應受瑞士的管轄並依其進行解釋，但不涉及其法律衝突條款。源自或有關這些使用條款（包括其有效性、無效性、違約或終止）的任何爭議、爭端或索賠，均應依照該等使用條款予以判決或仲裁。如果瑞士與您自己國家/地區的強制性消費者保護法不同，我們將給予您類似的保護。</p><h3>聯絡我們</h3><p>如對這些使用條款或一般事宜有任何疑問或意見，請透過下面的地址聯絡我們。如需索取我們持有的有關您的個人資料副本，也可使用此地址。</p><p>Giampiero Bodino AG<br>Hinterbergstrasse 22, Steinhausen, Switzerland<br><a href='mailto:giampiero.bodino@giampierobodino.com'>giampiero.bodino@giampierobodino.com</a><br><a href='mailto:press@giampierobodino.com'>press@giampierobodino.com</a></p>"
